import React, { useEffect } from "react";

const UserPage = () => {
  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/users/7").then((res) =>
      res.json()
    );
  }, []);

  return <div></div>;
};

export default UserPage;
